pragma solidity >=0.4.22 <0.9.0;

contract Ballot{

    struct Voter {
        uint weight;
        bool voted;
        uint vote;
    }

    struct Proposal {
        uint voteCount;
    }

    address chairperson;
    mapping(address => Voter) voters;
    Proposal[] proposals;

    uint totalWeights;

    modifier onlyChair() {
        require(msg.sender == chairperson);
        _;
    }

    modifier validVoter() {
        require(voters[msg.sender].weight > 0, "Not a Registered Voter");
        _;
    }

    // constructor : contract     
    constructor (uint numProposals) public {
        chairperson = msg.sender;
        voters[chairperson].weight = 2; //   2 

        for(uint prop = 0; prop < numProposals; prop++){
            proposals.push(Proposal(0));
        }

        totalWeights = 2; //   2
    }

    function register(address voter) public onlyChair {
        // if(msg.sender != chairperson || voters[voter].voted == true) revert();
        require (voters[voter].voted == false);
        voters[voter].weight = 1;
        // voters[voter].voted = false; // require .

        totalWeights += 1; //  
    }

    function vote(uint toProposal) public validVoter {
        Voter memory sender = voters[msg.sender]; // struct   storage type,       memory 
        // if(sender.voted == true || toProposal >= proposals.length) revert();
        require (sender.voted == false);
        require (toProposal < proposals.length);
        sender.voted = true;
        sender.vote = toProposal;
        proposals[toProposal].voteCount += sender.weight;
    }

    function reqWinner() public view returns (uint winningProposal) {
        uint winningVoteCount = 0;
        for(uint prop = 0; prop < proposals.length; prop++){
            if(proposals[prop].voteCount > winningVoteCount){
                winningVoteCount = proposals[prop].voteCount;
                winningProposal = prop;
            }
        }

        assert(winningVoteCount >= (totalWeights / 2)); //   
    }
}
